import logo from './logo.svg';
import './App.css';
import UsersCountainer from './components/users/UsersContainer'

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;




function initApp() {
  // this is hit API to setState on countries
  fetchCountries('https://restcountries.eu/rest/v2/region/europe')
    .then(response => {
      setCountries(response);
      setSubregionFilterVal("");
      setLanguageFilterVal("");
      setLoading(true);
      setCachedCountries(response);
    })
    .catch(error => {
      setError(error.message);
      setLoading(true)
    })
}
